import React from 'react';
import Header from '../../Componentes/Header/Header';

function MainPage() {
  return (
    <>
      <Header />
      <div>
        <h1>Desenvolvedor Web</h1>
        <h2>Fronte</h2>
      </div>
      <h1>MainPage</h1>
    </>
  );
}

export default MainPage;
